import React from 'react';
import './App.css'
import Nav from './Nav';
import About from './About';
import Services from './Services';
import Projects from './Projects';
import Contact from './Contact';
import { BrowserRouter as router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
      </div>
    </Router>
  );
}

export default App;
